import "./App.css";
import RecipeGrid from "./Components/RecipeGrid";
import React, { useState } from "react";
import { Login } from "../Login";
import { Register } from "../Register";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <RecipeGrid />
      </header>
      <Login></Login>
    </div>
  );
}

export default App;
